import react from "react";
import { Container, Grid, Stack } from "@mui/material";
import GenericInputField from "./TextField";
import { Box } from "@mui/system";

export default function UserEntry() {
  return (
    <>
      <Box
        sx={{
          width: 100,
          height: 100,
          borderRadius: 1,
          bgcolor: "blue",
          "&:hover": {
            bgcolor: "primary.dark",
          },
        }}
      ></Box>
      <Grid
        container
        direction="column"
        spacing={2}
        justifyContent="center"
        alignItems="center"
        height="100vh"
        width="30%"
        justify="center"
        sx={{
          boxShadow:
            "-2px 2px 4px rgba(0, 0, 0, 0.5), 2px -2px 0 rgba(255, 255, 255, 0.9)",
        }}
      >
        <Grid item>
          <GenericInputField
            label="FirstName"
            helperText="FirstName"
            errorStatus={false}
          />
        </Grid>
        <Grid item>
          <GenericInputField
            label="LastName"
            helperText="LastName"
            errorStatus={false}
          />
        </Grid>
        <Grid item>
          <GenericInputField
            label="Email"
            helperText="Email"
            errorStatus={false}
          />
        </Grid>
      </Grid>
    </>
  );
}
